async function a(){try{let a=await fetch("statistik_sokande.json"),t=await a.json();if(t){let a=t.sort((a,t)=>parseInt(t.applicantsTotal)-parseInt(a.applicantsTotal)).slice(0,6),e=t.sort((a,t)=>parseInt(t.applicantsTotal)-parseInt(a.applicantsTotal)).slice(0,5);(function(a){let t=a.map(a=>a.name),e=a.map(a=>parseInt(a.applicantsTotal));new Chart(document.getElementById("barChart"),{type:"bar",data:{labels:t,datasets:[{label:"Total Applicants",data:e,backgroundColor:"rgba(75, 192, 192, 0.2)",borderColor:"rgba(75, 192, 192, 1)",borderWidth:1}]},options:{scales:{y:{beginAtZero:!0,onlyInteger:!0}}}})})(a),function(a){let t=a.map(a=>a.name),e=a.map(a=>parseInt(a.applicantsTotal));new Chart(document.getElementById("pieChart"),{type:"pie",data:{labels:t,datasets:[{data:e,backgroundColor:["rgba(255, 99, 132, 0.2)","rgba(255, 205, 86, 0.2)","rgba(54, 162, 235, 0.2)","rgba(75, 192, 192, 0.2)","rgba(153, 102, 255, 0.2)"],borderColor:["rgba(255, 99, 132, 1)","rgba(255, 205, 86, 1)","rgba(54, 162, 235, 1)","rgba(75, 192, 192, 1)","rgba(153, 102, 255, 1)"],borderWidth:1}]}})}(e)}else console.error("Data not available.")}catch(a){console.error("Error fetching data:",a)}}document.addEventListener("DOMContentLoaded",function(){a()});